export const CallBackPage = () => {
  return (
    <div className="callback">
      <h2>
        useCallback is used to memoize a function so that it is only recreated
        when the dependencies change. This is useful when passing functions as
        props to child components. By using useCallback, the function is only
        recreated when needed and not on every render.
      </h2>
    </div>
  );
};
